import './index.scss'
import {AnimatedTree} from "react-tree-graph";
import data from "./data";

const About = () => {

    return (
        <>
            <div className="container home-page">
                <div className="text-zone">
                    <h1>   </h1>
                        <AnimatedTree className="flat-button"
                            data={data}
                            height={400}
                            width={400}/>

                </div>
            </div>
        </>
    );
}

export default About
